class Solution:
    def operate(self, output: list, operator: str):
        print(f"Performing {operator} on {output}")
        match operator:
            case "+":
                b = output.pop(-1)
                a = output.pop(-1)
                output.append(a + b)
            case "-":
                b = output.pop(-1)
                a = output.pop(-1)
                output.append(a - b)
            case "*":
                b = output.pop(-1)
                a = output.pop(-1)
                output.append(a * b)
            case "/":
                b = output.pop(-1)
                a = output.pop(-1)
                output.append(int(a / b))

    def calculate(self, s: str) -> int:
        output = []
        operators = []
        precedence = {
            "-": 2,
            "+": 2,
            "/": 3,
            "*": 3,
        }
        print(s)
        chars = list(s)

        print(f"Input = {chars}")
        i = 0
        number = None
        first = True
        while i < len(chars):
            char = chars[i]
            if char == " ":
                print("Empty, continue")
                i += 1
                continue
            reset_first = False
            print(f"Start: Token = {char} and output = {output}, last 5 operations = {operators[-5:]}")
            if char.isnumeric():
                number = number * 10 + int(char) if number is not None else int(char)
            else:
                if number is not None:
                    output.append(number)
                    number = None
                if char in precedence.keys():
                    if first and char == "-":
                        output.append(0)
                    while operators and operators[-1] != "(" and precedence[operators[-1]] >= precedence[char]:
                        self.operate(output, operators.pop(-1))
                    operators.append(char)
                elif char == "(":
                    operators.append(char)
                    reset_first = True
                elif char == ")":
                    while operators and operators[-1] != "(":
                        self.operate(output, operators.pop(-1))
                    operators.pop(-1)
            i += 1
            print(f"End:   Token = {char} and output = {output}")
            first = reset_first or False
            print()
        if number is not None:
            output.append(number)

        print(f"End: output = {output} and operators = {operators} and number = {number}")
        while operators:
            self.operate(output, operators.pop(-1))

        return output[0]

